import React from 'react';

export default class Rules extends React.Component {
    render() {

        return (
            <div className="rules-container"> 
                <div className="rules" id="easy-rules">Hard Rules</div>
                <div className="rules" id="medium-rules">Hard Rules</div>
                <div className="rules" id="hard-rules">Hard Rules</div>
            </div>
        )
    }

}
